    def generate(self, Form):



        C1 = string.ascii_letters
        C2 = string.digits
        C3 = string.punctuation

        random_arrange = C1 + C2 + C3 

        pwd_length = self.hashed.value()
        pwd = ''
        for i in range(pwd_length):
            pwd += ''.join(secrets.choice(random_arrange))
        self.hashlabel.setText(pwd)
        self.hashlabel.adjustSize()



